function prepareOverLayoutListeners() {
    Utils.addEventListener("fitlayout", fitOverLayout);
    Utils.addEventListener("lockscreen", function() {
        stage_over && stage_over.started && stage_over.stop()
    });
    Utils.addEventListener("unlockscreen", function() {
        stage_over && !stage_over.started && stage_over.start()
    })
}

function build2ndBackground() {
    stage_over && stage_over.drawScene(document.getElementById("screen_over_static"), !0)
}

function setContainerProps(a, d) {
    a.style.position = "absolute";
    a.style.left = "0px";
    a.style.top = "0px";
    a.style.width = d.width + "px";
    a.style.height = d.height + "px"
}

function fitOverLayout() {
    var a = document.getElementById("screen").style.width,
        d = document.getElementById("screen").style.height,
        a = a.substr(0, a.length - 2),
        d = d.substr(0, d.length - 2);
    Utils.resizeElement("screen_over", a, d);
    Utils.resizeElement("screen_over_static", a, d);
    document.getElementById("screen_wrapper_over").style.width = ~~a + "px";
    document.getElementById("screen_wrapper_over").style.height = ~~d + "px";
    document.getElementById("screen_wrapper_over_static").style.width = ~~a + "px";
    document.getElementById("screen_wrapper_over_static").style.height = ~~d + "px";
    setContainerProps(document.getElementById("screen_container_over"), Utils.getWindowRect());
    setContainerProps(document.getElementById("screen_container_over_static"), Utils.getWindowRect());
    stage_over && (stage_over.drawScene(document.getElementById("screen_over")), build2ndBackground())
}

function createOverScene() {
    createStageOver();
    stage_over.start();
    document.getElementById("screen_container_over").style.display = "block";
    document.getElementById("screen_container_over_static").style.display = "block"
}

function createStageOver() {
    stage_over && (stage_over.destroy(), stage_over.stop());
    stage_over = new Stage("screen_over", 480, 320);
    stage_over.delay = 1E3 / fps;
    stage_over.showFPS = !1;
    stage_over.onpretick = preTick2nd;
    stage_over.setBackgroundCanvas("screen_over_static");
    stage_over.addSpecialDynamicListeners()
}

function preTick2nd() {
    stage_over.rebuildBack && (stage_over.rebuildBack = !1, build2ndBackground())
}

function getResolution() {
    var a = Utils.getMobileScreenResolution(LANDSCAPE_MODE);
    1 == GET.debug && (a = Utils.getScaleScreenResolution(1, LANDSCAPE_MODE));
    Utils.globalScale = a.scale;
    var d = Math.round(a.width),
        e = Math.round(a.height);
    a.width = d;
    a.height = e;
    return a
}

function createProxies(a) {
    return a.map(createProxy)
}

function createProxy(a) {
    if (a instanceof Sprite) {
        var d = new Sprite(null, a.width, a.height);
        d.setPosition(a.x, a.y);
        d.static = a.static;
        d.onclick = a.onclick;
        d.onmouseover = a.onmouseover;
        d.onmouseup = a.onmouseup;
        d.onmousedown = a.onmousedown;
        d.fillColor = "#FFFFFD";
        stage.addChild(d);
        return a.proxy = d
    }
}

function setBackgroundScale() {
    var a = Utils.getWindowRect();
    document.getElementById("screen_background_container").style.backgroundSize = a.width + "px " + a.height + "px"
}
